import React,{Component} from "react";
const numbers = [1,2,3,"kek"];

class Template extends Component{

    render() {
        const full = numbers.map((number,index) =>
        {
            return (
                    <tr key={index}>
                        <td>{number}</td>
                    </tr>
            );
        });
        return full;

}
}
export default Template;
